import Mycontacts from "../components/Contents/Mycontacts";

const linkedin = ReactDOM.render(
    <SocialIcon url="https://www.linkedin.com/in/shashi-kumar-0680009b" />,
    document.body
  );

const Contact = () => {
  return (
    <div>
      <div>
        <Mycontacts />
      </div>
      <h2>My Contact Page!</h2>
      <p>Hi, There. You are welcome on my contact page.</p>
      <a>{linkedin}</a>
    </div>
  );
};

export default Contact;
